import React, { useState } from 'react';
import axios from 'axios';

const Email = () => {
    const [emailData, setEmailData] = useState({
        to: '',
        subject: '',
        body: ''
    });

    const handleInputChange = (e) => {
        setEmailData({
            ...emailData,
            [e.target.name]: e.target.value
        });
    };

    const sendEmail = () => {
        axios.post('https://localhost:7190/api/sendEmail', emailData)
            .then(response => {
                console.log(response.data);
            })
            .catch(error => {
                console.error(error);
            });
    };

    return (

        <>
        <form>
            <div className="form-row">
                    <div className="form-group col-md-6">
                    <label for="inputEmail4">To</label>
                        <input type="email" class="form-control" id="inputEmail4" onChange={handleInputChange} placeholder="Write email"/>
                </div>
                    <div className="form-group">
                        <label for="inputAddress">Subject</label>
                        <input type="text" class="form-control" id="inputAddress" onChange={handleInputChange} placeholder="Subject"/>
                    </div>
                </div>
                <div className="form-group">
                    <label for="exampleFormControlTextarea1">Body</label>
                    <textarea className="form-control" id="exampleFormControlTextarea1" onChange={handleInputChange} rows="3"></textarea>
                    <button type="submit" onClick={sendEmail} className="btn btn-primary mb-2">Send Email</button>
                </div>

            </form>
        
        <div>
            <label>To:</label>
            <input type="text" name="to" onChange={handleInputChange} />

            <label>Subject:</label>
            <input type="text" name="subject" onChange={handleInputChange} />

            <label>Body:</label>
            <textarea name="body" onChange={handleInputChange}></textarea>

            <button onClick={sendEmail}>Send Email</button>
            </div>
        </>
    );
};

export default Email;
